subSubSection.paragraph:
M2: Three examples are available (
figs. 10A, G–H
). Cusp t3 is entirely absent on 
AMF 68770
(
fig. 10A
), is represented by a small nubbin positioned near the crown base on another (ANWCP22; 
fig. 10H
), and is represented by a larger nubbin in the same position on the third (ANWCP24; 
fig. 10F
).

The posterior cingulum is discrete in all but the most heavily worn example of m1 (ANWCP9, 
fig. 11D
), where it is united by a common dentin pool to the hypoconid.

