The posterior cingulum in the most heavily worn example of m2 (ANWCP9, 
fig. 11D
) is united by a common dentin pool to both the hypoconid and entoconid.

DENTARY (
fig. 16
): All 15 dentaries attributed to this taxon are damaged and no specimen preserves either the coronoid or angular processes or the articular condyle. The 
holotype
(ANWCP32, 
fig. 16A–B
) and three other specimens at contrasting wear stages illustrate the changes in mandibular form that occur through life (
fig. 16
).
